import React from 'react';
import { Route, Routes } from 'react-router-dom';
import { routes } from './routes';

function App() {

  return (
    <Routes>

      {routes.map((route, index) => {
        return (
          <Route key={index} path={route.path} exact={route.exact} element={route.component} />)
      })}
    </Routes>
  );
}

export default App;
